import React from 'react';
import Header from './navBar';
import Footer from './footer';
import './contactUs.css';



function Contact() {
  return (
    <div>
      <Header />
      <div className="box">
      <i className="fa fa-user"></i>
      </div>
      <div className="square"></div>
    </div>
  )
}

export default Contact;
